import React, { Component, Fragment } from "react";

class Profil extends react.Component {
  state = {
    userName: ""
  };

  ender() {
    return (
      <Fragment>
        <h2>Profile</h2>
        <form>
          <label>UserName</label>
          <input type="text" required></input>
          <button> Register </button>
        </form>
      </Fragment>
    );
  }
}

export default Profil;
